import React from 'react';
import Card from "./Card"

const cardlist = ({robots2} )=> {
    return(
        <div>
            <Card id={robots2[0].id} name={robots2[0].name} email={robots2[0].email} />
            <Card id={robots2[1].id} name={robots2[1].name} email={robots2[1].email} />
            <Card id={robots2[2].id} name={robots2[2].name} email={robots2[2].email} />
        </div>
    )
}

export default cardlist
